import React from "react";
import './filter.css'
import {MdKeyboardArrowLeft} from 'react-icons/md'

const Filter = () => {
    return ( 
        <>
            <div className="filter-group">
                <ul className="filter-group-list">
                    <li className="filter-group-list-item">عروسک<div></div></li>
                    <li className="filter-group-list-item">لباس شخصیت های کارتونی<div></div></li>
                    <li className="filter-group-list-item">عروسک دست ساز<div></div></li>
                    <li className="filter-group-list-item">تم تولد<div></div></li>
                    <li className="filter-group-list-item">جاکلیدی عروسکی<div></div></li>
                </ul>
            </div>
        </>
    );
}
 
export default Filter;
